import { CircularProgress, Button } from "@material-ui/core";
const Quiz = ({questions}) => {
	return (
		questions ? (
			<div>{questions["incorrect_questions"].map(q => <Button value={q}></Button>)}</div>
		) : 
		(<CircularProgress
          style={{margin: 200}}
          color="inherit"
          size={50}
          thickness={1}
        />)
	)
}
export default Quiz;
